import{_ as i,c as t,o as n,ag as o}from"./chunks/framework.CA4hJK0u.js";const p=JSON.parse('{"title":"Troubleshooting Guide","description":"","frontmatter":{},"headers":[],"relativePath":"en/content/1.introduction/4.troubleshooting.md","filePath":"en/content/1.introduction/4.troubleshooting.md","lastUpdated":1770735100000}'),a={name:"en/content/1.introduction/4.troubleshooting.md"};function s(l,e,r,c,d,h){return n(),t("div",null,[...e[0]||(e[0]=[o(`<h1 id="troubleshooting-guide" tabindex="-1">Troubleshooting Guide <a class="header-anchor" href="#troubleshooting-guide" aria-label="Permalink to &quot;Troubleshooting Guide&quot;">​</a></h1><p>This guide is intended to help you diagnose and resolve common issues you may encounter when using AgentKit. If you cannot find a solution here, feel free to contact us via <a href="https://github.com/volcengine/agentkit-sdk-python/issues" target="_blank" rel="noreferrer">GitHub Issues</a>.</p><h2 id="installation-issues" tabindex="-1">Installation Issues <a class="header-anchor" href="#installation-issues" aria-label="Permalink to &quot;Installation Issues&quot;">​</a></h2><h3 id="_1-agentkit-command-not-found" tabindex="-1">1. <code>agentkit</code> command not found <a class="header-anchor" href="#_1-agentkit-command-not-found" aria-label="Permalink to &quot;1. \`agentkit\` command not found&quot;">​</a></h3><ul><li><strong>Symptom</strong>: When running the <code>agentkit</code> command in the terminal, the system reports <code>command not found</code>.</li><li><strong>Cause</strong>: This is usually because the executable path installed by <code>pip</code> has not been added to the system <code>PATH</code> environment variable.</li><li><strong>Solution</strong>: <ul><li>Confirm install location: Run <code>pip show agentkit-sdk-python</code> or <code>uv pip show agentkit-sdk-python</code> and find the install path indicated by the <code>Location</code> field.</li><li>Locate the executable: Under the install path’s <code>bin</code> directory (for example <code>.../site-packages/bin</code>), you should be able to find the <code>agentkit</code> executable.</li><li>Add to PATH: Add the absolute path of this <code>bin</code> directory to your <code>~/.bashrc</code>, <code>~/.zshrc</code>, or other shell configuration files.<div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">export</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> PATH</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;/path/to/your/python/bin:</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">$PATH</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;</span></span></code></pre></div></li><li>Reload configuration: Run <code>source ~/.bashrc</code> or restart the terminal to apply the changes.</li></ul></li></ul><h3 id="_2-dependency-conflicts" tabindex="-1">2. Dependency conflicts <a class="header-anchor" href="#_2-dependency-conflicts" aria-label="Permalink to &quot;2. Dependency conflicts&quot;">​</a></h3><ul><li><strong>Symptom</strong>: When installing <code>agentkit-sdk-python</code>, <code>pip</code> reports dependency version conflicts.</li><li><strong>Cause</strong>: Your Python environment may already contain library versions that are incompatible with AgentKit.</li><li><strong>Solution</strong>: <ul><li>Use a virtual environment (recommended): We strongly recommend using <code>uv</code> or <code>venv</code> to create a clean virtual environment in your project to avoid conflicts with system-level Python packages.<div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">uv</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> venv</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">source</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> .venv/bin/activate</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">uv</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> pip</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> agentkit-sdk-python</span></span></code></pre></div></li><li>Clean and reinstall: If you must use the existing environment, uninstall and reinstall:<div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">pip</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> uninstall</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> agentkit-sdk-python</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">pip</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> agentkit-sdk-python</span></span></code></pre></div></li></ul></li></ul><h2 id="configuration-issues" tabindex="-1">Configuration Issues <a class="header-anchor" href="#configuration-issues" aria-label="Permalink to &quot;Configuration Issues&quot;">​</a></h2><h3 id="_1-environment-variables-not-taking-effect" tabindex="-1">1. Environment variables not taking effect <a class="header-anchor" href="#_1-environment-variables-not-taking-effect" aria-label="Permalink to &quot;1. Environment variables not taking effect&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Prompts indicate it cannot connect to AgentKit Platform or authentication fails.</li><li><strong>Cause</strong>: Required environment variables may not have been passed in, or incorrect environment variable names were used.</li><li><strong>Solution</strong>: <ul><li>Confirm required environment variables are set</li></ul><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">echo</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> $VOLCENGINE_ACCESS_KEY</span></span>
<span class="line"><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">echo</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> $VOLCENGINE_SECRET_KEY</span></span></code></pre></div><ul><li>Ensure there are no extra spaces or quotes</li><li>Re-export the environment variables in the current shell session</li></ul></li></ul><h3 id="_2-configuration-file-format-error" tabindex="-1">2. Configuration file format error <a class="header-anchor" href="#_2-configuration-file-format-error" aria-label="Permalink to &quot;2. Configuration file format error&quot;">​</a></h3><ul><li><strong>Symptom</strong>: When running <code>agentkit launch</code>, it reports configuration file parsing failure.</li><li><strong>Cause</strong>: File format issues</li><li><strong>Solution</strong>: <ul><li>Check whether <code>agentkit.yaml</code> is formatted correctly (pay attention to indentation)</li><li>Re-run <code>agentkit config</code> to generate configuration</li></ul></li></ul><h2 id="deployment-issues" tabindex="-1">Deployment Issues <a class="header-anchor" href="#deployment-issues" aria-label="Permalink to &quot;Deployment Issues&quot;">​</a></h2><h3 id="_1-cr-creation-failed" tabindex="-1">1. CR creation failed <a class="header-anchor" href="#_1-cr-creation-failed" aria-label="Permalink to &quot;1. CR creation failed&quot;">​</a></h3><ul><li><strong>Symptom</strong>:</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CreateRegistry: QuotaExceeded.Registry The quota of Registry is exceeded.</span></span></code></pre></div><ul><li><strong>Cause</strong>: Insufficient account quota</li><li><strong>Solution</strong>: <ul><li>Number of CR instances exceeds the quota limit</li><li>In <code>agentkit config</code>, configure it to use an existing CR instance name</li><li>Or contact the administrator to increase quota</li></ul></li></ul><h3 id="_2-image-build-failed" tabindex="-1">2. Image build failed <a class="header-anchor" href="#_2-image-build-failed" aria-label="Permalink to &quot;2. Image build failed&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Pipeline build fails and reports dependency installation errors.</li><li><strong>Cause</strong>: Dependency installation failure</li><li><strong>Solution</strong>: <ul><li>Check whether dependencies in <code>requirements.txt</code> are correct</li><li>Confirm dependency versions are compatible with Python 3.12</li><li>Check Pipeline logs for detailed error information (logs will be automatically downloaded to your local root directory; pay attention to prompts in the interactive UI and find a file named like pipeline_failed_****ff20ce223.log in the root directory)</li></ul></li></ul><h3 id="_3-runtime-deployment-timeout" tabindex="-1">3. Runtime deployment timeout <a class="header-anchor" href="#_3-runtime-deployment-timeout" aria-label="Permalink to &quot;3. Runtime deployment timeout&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Runtime stays in <code>Releasing</code> state for a long time.</li><li><strong>Cause</strong>: The first deployment takes longer, or there may be insufficient resources.</li><li><strong>Solution</strong>: <ul><li>The first deployment usually takes 2–3 minutes; please be patient</li><li>Use <code>agentkit status</code> to check status</li><li>If it is still not ready after 5 minutes, resources may be insufficient; try <code>agentkit destroy</code> and then redeploy</li></ul></li></ul><h3 id="_4-runtime-status-abnormal" tabindex="-1">4. Runtime status abnormal <a class="header-anchor" href="#_4-runtime-status-abnormal" aria-label="Permalink to &quot;4. Runtime status abnormal&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Runtime status is <code>Failed</code> or <code>Error</code>.</li><li><strong>Cause</strong>: Internal Runtime exception</li><li><strong>Solution</strong>: <ul><li>Check whether environment variable configuration is correct (especially the model API Key)</li><li>Check logs in the AgentKit Platform console</li><li>Confirm the application code has no startup errors</li><li>Try cleaning up with <code>agentkit destroy</code> and redeploying</li></ul></li></ul><h2 id="invocation-issues" tabindex="-1">Invocation Issues <a class="header-anchor" href="#invocation-issues" aria-label="Permalink to &quot;Invocation Issues&quot;">​</a></h2><h3 id="_1-invoke-failed" tabindex="-1">1. invoke failed <a class="header-anchor" href="#_1-invoke-failed" aria-label="Permalink to &quot;1. invoke failed&quot;">​</a></h3><ul><li><strong>Symptom</strong>: When running <code>agentkit invoke</code>, it reports connection failure or timeout.</li><li><strong>Cause</strong>: Network issues or incorrect Endpoint configuration</li><li><strong>Solution</strong>: <ul><li>Use <code>agentkit status</code> to confirm Runtime status is <code>Ready</code></li><li>Check network connectivity</li><li>Confirm the Endpoint address is correct</li><li>Check firewall or proxy settings</li></ul></li></ul><h3 id="_2-model-invocation-failed" tabindex="-1">2. Model invocation failed <a class="header-anchor" href="#_2-model-invocation-failed" aria-label="Permalink to &quot;2. Model invocation failed&quot;">​</a></h3><ul><li><strong>Symptom</strong>: The Agent returns an error indicating model access failure.</li><li><strong>Cause</strong>: Incorrect model API Key configuration or exhausted model quota</li><li><strong>Solution</strong>: <ul><li>Confirm the Ark model API Key configuration is correct</li><li>Check whether the endpoint ID is valid</li><li>Confirm whether model quota has been exhausted</li><li>Log in to the Ark platform to check API Key permissions</li></ul></li></ul><h2 id="permission-issues" tabindex="-1">Permission Issues <a class="header-anchor" href="#permission-issues" aria-label="Permalink to &quot;Permission Issues&quot;">​</a></h2><h3 id="_1-ak-sk-authentication-failed" tabindex="-1">1. AK/SK authentication failed <a class="header-anchor" href="#_1-ak-sk-authentication-failed" aria-label="Permalink to &quot;1. AK/SK authentication failed&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Reports <code>InvalidAccessKeyId</code> or <code>SignatureDoesNotMatch</code>.</li><li><strong>Cause</strong>: Incorrect AK/SK configuration or insufficient permissions</li><li><strong>Solution</strong>: <ul><li>Confirm AK/SK is correct and valid</li><li>Check whether you have access permissions for the AgentKit service</li><li>Confirm AK/SK has not been disabled or expired</li><li>Contact the administrator to assign the required permissions</li></ul></li></ul><h3 id="_2-resource-access-denied" tabindex="-1">2. Resource access denied <a class="header-anchor" href="#_2-resource-access-denied" aria-label="Permalink to &quot;2. Resource access denied&quot;">​</a></h3><ul><li><strong>Symptom</strong>: Reports <code>AccessDenied</code> or insufficient permissions.</li><li><strong>Cause</strong>: The account does not have enough permissions to perform the operation</li><li><strong>Solution</strong>: <ul><li>Confirm the account has the required permissions for the relevant resources</li><li>Check IAM role configuration</li><li>Contact the administrator to grant necessary permissions</li></ul></li></ul><h2 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-label="Permalink to &quot;Getting Help&quot;">​</a></h2><p>If the above solutions cannot resolve your issue, please:</p><ol><li><p><strong>Check logs</strong>:</p><ul><li>Local logs: Check command line output</li><li>Platform logs: Visit the AgentKit console to view detailed logs</li></ul></li><li><p><strong>Contact support</strong>:</p><ul><li>Provide detailed error information and logs</li><li>Describe reproduction steps</li><li>Attach relevant configuration files (be sure to redact sensitive data)</li><li>Contact Volcengine technical support</li></ul></li><li><p><strong>Read the docs</strong>:</p><ul><li><a href="https://www.volcengine.com/docs/86681/1844878" target="_blank" rel="noreferrer">Volcengine Official Documentation</a></li><li><a href="https://www.volcengine.com/docs/86681/2085690?lang=zh" target="_blank" rel="noreferrer">Official website FAQ</a></li></ul></li></ol>`,36)])])}const g=i(a,[["render",s]]);export{p as __pageData,g as default};
